import React, { Component } from "react";
import styled from "styled-components";

export class Info extends Component {
  render() {
    return (
      <section>
        <h1>What are the symptoms?</h1>
        <ul>
          <li>Fever</li>
        </ul>
      </section>
    );
  }
}
const InfoWrapper = styled.section`
  color: rgb(232, 245, 23);
`;
export default Info;
